📸✨ Thrilled to share that I had the incredible opportunity to shoot not one, not two, but THREE covers for @foodandwine Magazine this year! 🍽️🍷 Each project was a journey of creativity and collaboration, and I'm beyond grateful for the chance to bring these delicious stories to life.⁣
🙌 Huge shoutout to the amazing team at Food & Wine for entrusting me with these exciting projects. It's been an honor to contribute to the pages of a publication that celebrates the artistry of food and the joy it brings to our lives.

📚 Reflecting on this year's covers, I'm reminded of the incredible journey and growth since I first stepped into this industry. Here's to the endless possibilities that creativity and collaboration bring! 🥂 & I cant wait for whats in store for next year! BRING IT 2024!

