Truth be told it wasn’t until I was in my late 30s when my daughter was brave enough to try and enjoy oysters that I finally came around to them. I’d eat them every so often …. Because I knew all my friends couldn’t be wrong .. they must be good ! and I didn’t want to miss out. After many attempts of the corse of many years.. one day i met the right oyster and it all clicked! I have though, always thought they were and are one of the most magnificent creatures to photograph. 📸👩🏼‍🍳🦪🍾⁣Shot for Wine Food book 

